ncorrect, or unanswered.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"localize\":{\"fullscreen\":\"Fullscreen\",\"exitFullscreen\":\"Exit fullscreen\"}},\"library\":\"H5P.DragQuestion 1.13\",\"metadata\":{\"contentType\":\"Drag and Drop\",\"license\":\"U\",\"title\":\"Classify the following living things into: producers (produce their own food), consumers (they consume other plants or animals), or decomposers (they breakdown dead animals).\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Classify the following living things into: producers (produce their own food), consumers (they consume other plants or animals), or decomposers (they breakdown dead animals).\"},\"subContentId\":\"a85935dc-4a79-4272-b3aa-c329e4e0398b\"},\"useSeparator\":\"disabled\"},{\"useSeparator\":\"auto\",\"content\":{\"params\":{\"text\":\"<h3><strong>Activity 2</strong></h3>\\n\\n<p>Green plants use the food found in seeds as it germinates. Once it grows, it starts to produce its own food by a process called photosynthesis. You will learn all about photosynthesis in the next section! </p>\\n\\n<p>Once plants make their own food, they use some of it and store some of it. Plants store the food they make in different parts: stem, leaves, flowers, fruits, seeds, tubers (roots).</p>\\n\\n<p>The image below shows different plants storing food in different parts.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"8949b662-d21f-4c4b-bc86-d14801004ab8\"}},{\"content\":{\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAm8AAAFGCAIAAACzH++8AAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAP+lSURBVHhe7P0HoC5XeR4KTy9fL7v3enrTURdqIDpCQmAwxDaOsXFCuXHi4CTOTW6S/+b6z5+be0PsxMbBLcGSaQYhZEANISHUj45Ob7v3/fU2vf3PO7PP1ulIAikYf8/5zuyZNWvWrLVmzfu8z5o1a9ggCJg22mijjTbaaOMnAL
